import"./boot.js";const caseMap={},DASH_TO_CAMEL=/-[a-z]/g,CAMEL_TO_DASH=/([A-Z])/g;export function dashToCamelCase(a){return caseMap[a]||(caseMap[a]=0>a.indexOf("-")?a:a.replace(DASH_TO_CAMEL,a=>a[1].toUpperCase()))}export function camelToDashCase(a){return caseMap[a]||(caseMap[a]=a.replace(CAMEL_TO_DASH,"-$1").toLowerCase())}